import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./ProviderPage.css";
import { Button, Modal } from "react-bootstrap";
import Navbar from "../NavbarComponent/Navbar";
import LogoutConfirmationModal from "../ModalsComponent/LogoutConfirmationModal";
import { useNavigate } from "react-router-dom";
import { useLocation } from "react-router-dom";

function ProviderPage() {
  const location = useLocation();
  const { numeAngajat, prenumeAngajat } = location.state || {};
  const navigate = useNavigate();
  const [show, setShow] = useState(false);
  const [data, setData] = useState([]);
  const [showLogoutConfirmation, setShowLogoutConfirmation] = useState(false);
  const [showUpdateModal, setShowUpdateModal] = useState(false);
  const [selectedTransmision, setSelectedTransmision] = useState("");

  const handleChangeTransmision = (event) => {
    setSelectedTransmision(event.target.value);
  };

  const [updateData, setUpdateData] = useState({
    furnizor: "",
    cui: "",
    regComertului: "",
    adresa: "",
    servicii: "",
    valabilitateaContractului: "",
  });

  const [formData, setFormData] = useState({
    furnizor: "",
    cui: "",
    regComertului: "",
    adresa: "",
    servicii: "",
    valabilitateaContractului: "",
  });

  const handleClose = () => {
    setShow(false);
    setFormData({
      furnizor: "",
      cui: "",
      regComertului: "",
      adresa: "",
      servicii: "",
      valabilitateaContractului: "",
    });
  };

  const [deleteVehicleId, setDeleteVehicleId] = useState("");
  const [showDeleteConfirmation, setShowDeleteConfirmation] = useState(false);
  const [searchMake, setSearchMake] = useState("");
  const [searchModel, setSearchModel] = useState("");
  const [searchTransmission, setSearchTransmission] = useState("");

  const handleShow = () => setShow(true);

  const handleLogout = () => {
    setShowLogoutConfirmation(true);
  };

  const handleConfirmLogOut = () => {
    setShowLogoutConfirmation(false);
    navigate("/");
  };

  const handleCancelLogOut = () => {
    setShowLogoutConfirmation(false);
  };

  const handleSearchMakeInputChange = (e) => {
    setSearchMake(e.target.value);
  };

  const handleSearchTransmissionChange = (e) => {
    setSearchTransmission(e.target.value);
  };

  const handleSearchModelInputChange = (e) => {
    setSearchModel(e.target.value);
  };

  let filteredData;

  if (searchMake) {
    filteredData = data.filter((car) => car.marca.includes(searchMake));
  } else if (searchTransmission) {
    filteredData = data.filter((car) =>
      car.cutieViteze.includes(searchTransmission)
    );
  } else if (searchModel) {
    filteredData = data.filter((car) => car.model.includes(searchModel));
  } else {
    filteredData = data;
  }

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Make a POST request to your API endpoint
    fetch(
      "http://localhost:5294/api/DateCompleteFurnizor/PreluareDateFurnizor",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          ...formData,
          cutieViteze: selectedTransmision,
        }),
      }
    )
      .then((response) => {
        if (response.ok) {
          // Refresh the employee list after successful POST
          fetch("http://localhost:5017/api/DateStoc")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              handleClose();
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          // Handle errors here
        }
      })
      .catch((error) => console.error("Error making POST request:", error));
  };

  useEffect(() => {
    fetch("http://localhost:5017/api/DateStoc")
      .then((response) => response.json())
      .then((data) => setData(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  const handleDeleteConfirmation = (deleteVehicleId) => {
    setDeleteVehicleId(deleteVehicleId);
    setShowDeleteConfirmation(true);
  };

  const handleOpenUpdateModal = (stocData) => {
    setShowUpdateModal(true);
    setUpdateData(stocData);
  };

  const handleDelete = () => {
    fetch(
      `http://localhost:5017/api/DateStoc/DeleteCarFromStock/${deleteVehicleId}`,
      {
        method: "DELETE",
      }
    )
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5017/api/DateStoc")
            .then((response) => response.json())
            .then((updatedData) => setData(updatedData))
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
          setShowDeleteConfirmation(false); // Close the delete confirmation modal
        } else {
          // Handle errors here
          console.error("Error deleting employee with CNP:", deleteVehicleId);
        }
      })
      .catch((error) => console.error("Error making DELETE request:", error));
  };

  const handleUpdate = (e) => {
    e.preventDefault();

    fetch(`http://localhost:5017/api/DateStoc/UpdateCarData/${updateData.id}`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(updateData),
    })
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5017/api/DateStoc")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              setShowUpdateModal(false);
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          console.error("Error updating employee with CNP:", updateData.cnp);
        }
      })
      .catch((error) => console.error("Error making PUT request:", error));
  };

  return (
    <div>
      <nav id="navbar">
        <div className="wrapper">
          <div className="logo">
            <a
              href="/adminHomePage"
              onClick={(e) => {
                e.preventDefault();
                navigate("/adminHomePage", {
                  state: {
                    numeAngajat: numeAngajat,
                    prenumeAngajat: prenumeAngajat,
                  },
                });
              }}
            >
              <img
                src="https://logos-world.net/wp-content/uploads/2022/07/Hertz-Logo.png"
                alt="Hertz Logo"
                style={{ maxWidth: "100px", maxHeight: "50px" }}
              />
            </a>
          </div>
          <span className="welcome-label">
            Welcome back, {numeAngajat} {prenumeAngajat}!
          </span>
          <input type="radio" name="slider" id="menu-btn" />
          <input type="radio" name="slider" id="close-btn" />
          <ul className="nav-links">
            <label htmlFor="close-btn" className="btn close-btn">
              <i className="fas fa-times"></i>
            </label>
            <li>
              <a
                href="/angajatPage"
                onClick={(e) => {
                  e.preventDefault(); // Prevent the default link behavior
                  navigate("/angajatPage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                    },
                  });
                }}
              >
                Angajati
              </a>
            </li>
            <li>
              <a href="">Stoc</a>
            </li>
            <input type="checkbox" id="showMega" />
            <li>
              <a href="">Furnizori</a>
            </li>
            <li>
              <a className="LogoutButton" onClick={handleLogout}>
                <i className="fas fa-sign-out-alt"></i> Log Out
              </a>
            </li>
          </ul>
          <label htmlFor="menu-btn" className="btn menu-btn">
            <i className="fas fa-bars"></i>
          </label>
        </div>
      </nav>
      <LogoutConfirmationModal
        show={showLogoutConfirmation}
        onHide={handleCancelLogOut}
        onConfirmLogout={handleConfirmLogOut}
      />

      <div className="container" style={{ marginTop: "160px" }}>
        <div className="crud shadow-lg p-3 mb-5 mt-5 bg-body rounded">
          <div className="row">
            <div className="col-sm-3 mt-5 mb-4 text-gred">
              <div className="search">
                <form className="form-inline">
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="Make"
                      aria-label="Search"
                      value={searchMake}
                      onChange={handleSearchMakeInputChange}
                    />
                  </div>
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="Model"
                      aria-label="Search"
                      value={searchModel}
                      onChange={handleSearchModelInputChange}
                    />
                  </div>
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="Transmission"
                      aria-label="Search"
                      value={searchTransmission}
                      onChange={handleSearchTransmissionChange}
                    />
                  </div>
                </form>
              </div>
            </div>
            <div className="col-sm-3 offset-sm-2 mt-5 mb-4 text-gred">
              <h2 style={{ color: "black" }}>
                <b>Providers</b>
              </h2>
            </div>
            <div className="col-sm-3 offset-sm-1 mt-5 mb-4 text-gred">
              <Button variant="primary" onClick={handleShow}>
                Add cars to stock
              </Button>
            </div>
          </div>
          <div className="row">
            <div className="table-responsive">
              <table className="table table-striped table-hover table-bordered custom-table">
                <thead>
                  <tr>
                    <th>Id</th>
                    <th>Make</th>
                    <th>Model</th>
                    <th>Engine Capacity</th>
                    <th>HP</th>
                    <th>Transmission</th>
                    <th>Seats</th>
                    <th>Color</th>
                    <th>Fuel</th>
                    <th>Tachometer</th>
                    <th>Price</th>
                    <th>Rental Type</th>
                    <th>Rent 1 Month</th>
                    <th>Rent 6 Months</th>
                    <th>Rent 12 Months</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredData.map((stoc) => (
                    <tr key={stoc.id}>
                      <td>{stoc.id}</td>
                      <td>{stoc.marca}</td>
                      <td>{stoc.model}</td>
                      <td>{stoc.capCilindrica}</td>
                      <td>{stoc.putere}</td>
                      <td>{stoc.cutieViteze}</td>
                      <td>{stoc.nrDeLocuri}</td>
                      <td>{stoc.culoare}</td>
                      <td>{stoc.combustibil}</td>
                      <td>{stoc.nrDeKm}</td>
                      <td>{stoc.pret}</td>
                      <td>{stoc.tipInchiriere}</td>
                      <td>{stoc.pretInchiriere1Luna}</td>
                      <td>{stoc.pretInchiriere6Luni}</td>
                      <td>{stoc.pretInchiriere12Luni}</td>
                      <td>
                        <a
                          className="edit"
                          title="Edit"
                          data-toggle="tooltip"
                          onClick={() => handleOpenUpdateModal(stoc)}
                        >
                          <i className="material-icons">&#xE254;</i>
                        </a>
                        <a
                          className="delete"
                          title="Delete"
                          data-toggle="tooltip"
                          onClick={() => handleDeleteConfirmation(stoc.id)}
                        >
                          <i className="material-icons">&#xE872;</i>
                        </a>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>

          {/* Delete Confirmation Modal */}
          <Modal
            show={showDeleteConfirmation}
            onHide={() => setShowDeleteConfirmation(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>
                Are you sure you want to delete the next entry? This action is
                irreversible.
              </Modal.Title>
            </Modal.Header>
            <Modal.Footer>
              <Button
                variant="secondary"
                className="btn-modal"
                onClick={() => setShowDeleteConfirmation(false)}
              >
                No
              </Button>
              <Button variant="danger" onClick={handleDelete}>
                Yes
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        <div>
          {/* Update Modal */}
          <Modal
            show={showUpdateModal}
            onHide={() => setShowUpdateModal(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Update Stock Values</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleUpdate}>
                <div className="form-group">
                  <label htmlFor="make">Make:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="make"
                    name="make"
                    value={updateData.marca}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, marca: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="model">Model:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="model"
                    name="model"
                    value={updateData.model}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, model: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="ec">Engine Capacity:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="ec"
                    name="ec"
                    value={updateData.capCilindrica}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        capCilindrica: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="hp">HP:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="hp"
                    name="hp"
                    value={updateData.putere}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        putere: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="transmision">Transmision:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="transmision"
                    name="transmision"
                    value={updateData.cutieViteze}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        cutieViteze: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="seats">Seats:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="seats"
                    name="seats"
                    value={updateData.nrDeLocuri}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        nrDeLocuri: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="color">Color:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="color"
                    name="color"
                    value={updateData.culoare}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, culoare: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="fuel">Fuel:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="fuel"
                    name="fuel"
                    value={updateData.combustibil}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        combustibil: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="tachometer">Tachometer:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="tachometer"
                    name="tachometer"
                    value={updateData.nrDeKm}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        nrDeKm: e.target.value,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="price">Price:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="price"
                    name="price"
                    value={updateData.pret}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        pret: e.target.value,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="rentalType">Rental Type:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="rentalType"
                    name="rentalType"
                    value={updateData.tipInchiriere}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        tipInchiriere: e.target.value,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="rental1Month">Rent 1 Month:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="rental1Month"
                    name="rental1Month"
                    value={updateData.pretInchiriere1Luna}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        pretInchiriere1Luna: e.target.value,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="rental6Month">Rent 6 Months:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="rental6Month"
                    name="rental6Month"
                    value={updateData.pretInchiriere6Luni}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        pretInchiriere6Luni: e.target.value,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="rental12Month">Rent 12 Months:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="rental12Month"
                    name="rental12Month"
                    value={updateData.pretInchiriere12Luni}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        pretInchiriere12Luni: e.target.value,
                      })
                    }
                  />
                </div>

                <button type="submit" className="btn btn-success mt-4">
                  Update data
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button
                variant="secondary"
                onClick={() => setShowUpdateModal(false)}
              >
                Close
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        {/* <!-- Model Box --> */}
        <div className="model_box">
          <Modal
            show={show}
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Add Car</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleSubmit}>
                <div className="form-group">
                  <input
                    type="text"
                    className="form-control"
                    name="marca"
                    value={formData.marca}
                    onChange={handleChange}
                    placeholder="Make"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="model"
                    value={formData.model}
                    onChange={handleChange}
                    placeholder="Model"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="capCilindrica"
                    value={formData.capCilindrica}
                    onChange={handleChange}
                    placeholder="Engine Capacity"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="putere"
                    value={formData.putere}
                    onChange={handleChange}
                    placeholder="HP"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <select
                    className="form-control"
                    name="Transmission"
                    value={selectedTransmision}
                    onChange={handleChangeTransmision}
                    required
                  >
                    <option value="" disabled>
                      {selectedTransmision
                        ? selectedTransmision
                        : "Select Transmission"}
                    </option>
                    <option value="Manual">Manual</option>
                    <option value="Automatic">Automatic</option>
                  </select>
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="nrDeLocuri"
                    value={formData.nrDeLocuri}
                    onChange={handleChange}
                    placeholder="Seats"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="culoare"
                    value={formData.culoare}
                    onChange={handleChange}
                    placeholder="Color"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="combustibil"
                    value={formData.combustibil}
                    onChange={handleChange}
                    placeholder="Fuel"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="nrDeKm"
                    value={formData.nrDeKm}
                    onChange={handleChange}
                    placeholder="Tachometer"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="pret"
                    value={formData.pret}
                    onChange={handleChange}
                    placeholder="Price"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="tipInchiriere"
                    value={formData.tipInchiriere}
                    onChange={handleChange}
                    placeholder="Rental Type"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="pretInchiriere1Luna"
                    value={formData.pretInchiriere1Luna}
                    onChange={handleChange}
                    placeholder="Rent 1 Month"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="pretInchiriere6Luni"
                    value={formData.pretInchiriere6Luni}
                    onChange={handleChange}
                    placeholder="Rent 6 Months"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="pretInchiriere12Luni"
                    value={formData.pretInchiriere12Luni}
                    onChange={handleChange}
                    placeholder="Rent 12 Months"
                    required
                  />
                </div>
                <button type="submit" className="btn btn-success mt-4">
                  Adaugare
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Inchidere
              </Button>
            </Modal.Footer>
          </Modal>
        </div>
      </div>
    </div>
  );
}

export default ProviderPage;
